post_text:
Just For Kix is a youth dance program that offers classes in Two Harbors, MN. It is not too late to register for classes!

We are so excited to begin and will be implementing our Back To Dance Protocol with our COVID-19 Procedures.

Our classes will be Tuesday evenings this year! Our classes include:
Tiny Kix (ages 3-not yet attended Kindergarten) from 5:00pm-5:30pm;
Wee-Petites (K-1st Grade) from 5:35pm-6:20pm;
Wee Kix (2nd-3rd Grade) from 6:25pm-7:25pm;
Mini Kix (4th-8th Grade) from 7:30pm-8:30pm.

Please email the new director, Jaclyn Dietl, at twoharbors_mn@justforkix.com with questions, or if you want a copy of our Back To Dance Protocol! I cannot wait to meet everyone and begin dance classes!

Additionally, you can register for classes at this link: https://www.justforkix.com/danceclasses/two-harbors-mn/

